import React from 'react'

const Workshops = ({ workshops }) => {
    <div>
        <table>
            <tr>
                <th>Nombre</th>
                <th>Objetivo</th>
            </tr>
            {workshops.map(
                workshop => (
                    <tr key={workshop.id}>
                        <td>{workshop.name}</td>
                        <td>{workshop.objective}</td>
                    </tr>
                )
            )}
        </table>
    </div>
}

export default Workshops;
